import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <div className='Navbar'>
        <div>My Todo List</div>
        <div>React</div>
      </div>
      <form className='Formbar'>
        <div>
          <label className='Formbar_name1'>제목</label>
          <input type='text' name='title' className='Formbar_input1'/>
          <label className='Formbar_name2'>내용</label>
          <input type='text' name='title' className='Formbar_input2'/>
        </div>
        <button className='Formbar_button'>추가하기</button>
      </form>
    </div>
  );
}

export default App;
